query Businesses($searchTerm: String, $latitude: Float, $longitude: Float) {
  search(term: $searchTerm, latitude: $latitude, longitude: $longitude) {
    __typename
    business {
      __typename
      id
      name
      url
      rating
      photos
      distance
    }
  }
}
